import React from "react";
import { render } from "react-dom";
import { Parallax } from "react-parallax";
import ParticlesBg from "particles-bg";
import { AwesomeButton } from "react-awesome-button";
import Code from "./components/Code.jsx";
import Icons from "./components/Icons.jsx";

import "react-awesome-button/dist/styles.css";
import "./App.css";

import image1 from "./assets/01.jpeg";
import image2 from "./assets/02.jpeg";
import image3 from "./assets/03.jpeg";
import image4 from "./assets/04.jpeg";
import image5 from "./assets/05.jpeg";



let config = {
  num: [4, 7],
  rps: 0.1,
  radius: [5, 40],
  life: [1.5, 3],
  v: [2, 3],
  tha: [-50, 50],
  alpha: [0.6, 0],
  scale: [.1, 0.9],
  
  position: "all",
  //color: ["random", "#ff0000"],
  cross: "dead",
  random: 10

  //config={config} style={{ height: 500 }} style={{ height: 500 }}
};



const App = () => (
  <div className="main">
    <div className="top"></div>

    <div className="container" style={{
        width: "100%",
        height: "100%",
        margin: "0",
        padding: "0"
      }}>
      <Parallax strength={500}>
        <ParticlesBg  style={{
          position: "absolute",
          top: 0,
          left: 0,
          width: "100%",
          height: "100%"
        }} color="#00ff73" type="cobweb" bg={true}/>
        <div className="maxbackground">
          <div className="boxs header">
            <h1 className="title">SoniDEX</h1>
            <h4 className="introduction">
              Exchange by Sonikchain
            </h4>
            <div className="buttons">
              <a href="https://github.com/lindelof/particles-bg">
                <AwesomeButton
                  size="medium"
                  type="secondary"
                >
                  Launch Exchange
                </AwesomeButton> 
              </a> 
              <div className="space"></div>
              <a href="https://github.com/nordicgiant2/gh-pages-theme">
                <AwesomeButton
                  size="medium"
                  type="primary"
                >
                  Documents
                </AwesomeButton>
              </a> 
            </div>
          </div>
        </div>
      </Parallax>

      
    </div>
   
    <div className="footer">® 2021 Sonikchain | All right reserved.</div>

  </div>
);

export default App;
